import React from 'react';
import { useOutletContext } from 'react-router-dom';
function Form() {
  const { setPull } = useOutletContext();

  return (
    <>
      <form onSubmit={null}>
        <input
          id="glass"
          type="text"
          name="firstname"
          value={null}
          onChange={null}
          placeholder="First Name"
        />
        <input
          id="glass"
          type="text"
          name="lastname"
          value={null}
          onChange={null}
          placeholder="Last Name"
        />
        <button id="glass" type="submit">
          Submit
        </button>
      </form>

      <small className="bottom" id="glass">
        Form
      </small>
    </>
  );
}

export default Form;
